import React from "react";
import './Dog.css'
import {Route, Link} from 'react-router-dom';





const Dog = (dog)=>{
    const d = dog.toLowerCase();
    if (!d) return <Link to="/"/>

    return (
      <div className="Dog">

          <img src={dog.src} alt={dog.name} />
          <div className="DogInfo">
             <Link to={`/dogs/${dog.name}`}>{dog.name}</Link> <br/>
             {dog.age} years old 



        </div>
        <div className="facts">

          {dog.facts.map((fact, i) => (
            <li key={i}>{fact}</li>
          ))}


        </div>
      </div>
    );
}

export default Dog;
